– Pradėkime nuo didžiausios aktualijos – švenčių. Ar populiaru dovanoti tatuiruotę? – Kadangi šventiniu laikotarpiu atostogoms namo grįžta kone visi emigrantai, didžiausią srauto dalį ir būtent jie ir sudaro. Manau, kad emigravę tėvynainiai ne tik kelia ekonomiką, išleisdami čia užsienyje uždirbtas lėšas, bet ir vietinių gyvenimo tempą, nes nori per trumpą laiką nuveikti labai daug: susitvarkyti plaukus, nagus, apsilankyti pas odontologą ar burnos higienistą. Ne išimtis ir tatuiruočių salonai. Kadangi per trumpą laiką vos ne tris kartus išauga paklausa, atvykėliai patys kelia kainas, nes daugelį užsakymų lydi frazė „tu tik padaryk, o aš sumokėsiu daugiau“. – Tatuiruotės tampa vis populiaresnės, tačiau daugelis žmonių tai vis dar neįsivaizduoja, kokius meno kūrinius galima turėti ant savo kūno, o vidutiniai ar prastesni meistrai tiesiog kopijuoja, pataikauja ir nekuria nieko originalaus ar meistriško. Ar jums neapmaudu dėl tokių klientų ir jų užgaidų? – Ši tema labai dažnai eskaluojama tatuiruočių meistrų bendruomenėse. Viskas labai pasikeitė kai tatuiruotes pradėjo daryti profesionalūs menininkai, kurie anksčiau užsiimdavo tokiomis sferomis kaip grafinis dizainas, tapyba, skulptūra ir panašiai. Prieš dešimt metų tatuiruotes darydavo paprasti žmones be meninio išsilavinimo, todėl vyravo gan nusistovėję motyvai bei technikos.Tai labiau buvo amatas. Į rinką atėję profesionalūs menininkai pradėjo laužyti nusistovėjusias taisykles ir kanonus, kurti naujus stilius, bandyti naujas technikas. Jiems į pagalbą atėjo ir tatuiravimo įrangos gamybos pramonė su savo parama. Natūralu, kad nejučiomis kilo konfliktas tarp senosios ir naujosios kartos. – Kokiu tatuiruočių stiliumi pats mėgstate kurti? – Ilgą laiką propagavau  black&grey  (pilkai juodos) realizmą. Bet dabar užsikrėčiau  dotwork  (taškavimo) ar  geometry  (geometrinės) stiliumi. Stengiuosi maišyti juos visus tris. Taip pat labai stengiuosi išvesti įdomią ar originalią tatuiruotės siužeto liniją arba tarsi scenarijų, pasakojimą. Daug kas priklauso nuo pačio užsakovo. Tik bendras idėjų generavimas priveda prie išties puikaus rezultato. Jei klientas labai spraudžia į rėmus, tiesiog tenka įgyvendinti jo norus. Būtent tokių darbų norėčiau ateityje atsisakyti. – O kokie piešiniai puošia jūsų kūną? – Mano tatuiruotės labai tampriai susijusios su išgyvenimais. Būna, kad kelis metus nieko nesidarau, bet būna, kad ateina impulsas iš aplinkos, kuris paskatina ir išgrynina naujos tatuiruotės idėją. Vienu metu labai domėjausi Antrojo pasaulinio karo temomis, todėl viena rankovė atspindi būtent šias mano mintis. Vėliau iškeliavau į Indiją ir ten praleidau nemažai laiko, sužinojau ir pajutau nuostabių dalykų, todėl nugaros tatuiruotę vadinu „Mama Indija“. Dabar turiu labai daug minčių apie „Žvaigždžių karus“, nes esu labai didelis Geogrge'o Lukaso kūrybos gerbėjas, bet dar tatuiruotes ta tema neturiu. Tiesą sakant, vieną idėją turiu, bet dar vis laukiu įkvėpimo ją įgyvendinti (šypsosi). – Neseniai viename iš savo socialiniuose tinkluose kuriamų vaizdo įrašų pasidalijote tikru nuotykiu. Kaunietis meistras tatuiruotę darė piešdamas laisva ranka (freehand). Tai – vienas sudėtingiausių stilių, tiesa? – Tiesa. Labai mėgstu šį stilių. Ypač užpildymams tarp tatuiruočių. Tik meistras, turintis aukštus techninius įgūdžius gali dirbt piešdamas laisva ranka. Tai tatuiruotės darymas kai gali atsipalaiduoti ir mėgautis procesu. Tam, kad skaitytojai aiškiau suprastų, apie ką mes čia kalbame, galiu pasakyti, kad tai stilius, kurį pasirinkus tatuiruotė daroma be eskizo. Piešiama tiesiog ant kūno iš galvos. (function(d, s, i, r) {
