		})(document, 'script', 'facebook-jssdk', 'fb-root'); – Kam jaučiate didesnį jaudulį darydamas tatuiruotę: artimam žmogui ar pirmąkart matomam klientui? – Asmeninės simpatjos, žinoma, egzistuoja. Yra klientų, kurių pats laukiu, o yra ir tokių, su kuriais dirbu sukandęs dantis. Artimiems visada būna sunkiau daryti, nes neva, jei pažįsti, tai gal kažkaip neskaudžiau daryk (šypsosi)? Svetimam žmogui ego neleidžia pasirodyti silpnam ar nepakančiam. – Šiandien, kai jau esate žinomas meistras, atrodo, kad viskas einasi sklandžiai. Bet kokia buvo ta tikroji pradžia? – Tai prasidėjo 1998 metais. Buvau šešiolikos metų paauglys ir apie braižo ieškojimus nė kalbos nebuvo. Kadangi buvau vienas iš pionierių, pagrindinis prioritetas buvo kokybė. Kokybiška tiesi linija, tolygus tušavimas juodai, šešėliavimas. Apie spalvas pirmus metus buvo galima tik pasvajoti. Ėmiausi bet kokio darbo, bet kokio stiliaus, todėl šiandien laikau save universaliu meistru, galinčiu padaryti ir  maori  ornamentus, ir japoniškus karpius, ir realistinį portretą. Mano išskirtinumas –tatuiravimo greitis. Taip yra todėl. kad aš nepaskęstu smulkiose detalėse. Padarau jų tiek, kiek reikia ir kur reikia. Taip pat ir mano temperamentas labai sangviniškas. Man tiesiog nepakanka kantrybės krapštytis (juokiasi). – Ar nebuvo artimųjų ar draugų požiūrio, jog tatuiruotės – tai būtinai narkomanų, asocialų ir kitų netinkamų žmonių reikalas bei nieko gero iš to nebus? – Kiek save prisimenu, visada buvau labai maištaujantis paauglys ir tatuiravimą priėmiau kaip maišto formą. Pirmąją tatuiruotę pasidariau būdamas penkiolikos. Neilgai trukus, padrąsintas ir įkvėptas mamos, nes maištas buvo labiau nukreiptas prieš tėvo autoritetą, o mama buvo tarsi mano sąjungininkė, pradėjau pats domėtis tatuiruotėmis. Net nežinojau nuo ko pradėti, tad pradžia buvo labai sunki ir miglota. Daug eksperimentavau tiesiog klausydamasis gandų, legendų ir mitų. Vieni jų buvo atėję iš kariuomenės struktūrų, kiti iš įkalinimo įstaigų. Daug kas manė, kad vartoju narkotikus. Ypač mokykloje sklido tokie gandai. – Šiandienė konkurencija negąsdina? Kartais atrodo, kad tatuiruotes gali daryti bet kas. Juk pakanka nusipirkti pirmąją mašinėlę, prisiminti, kad galbūt neblogai pieši ir susirasti studiją, kurioje galėtum tapti mokiniu. – Pastaraisiais metais socialinėse medijose tikrai mirga naujų meistrų ir naujų studijų skelbimai. Prieš gerus dešimt metų buvo gal dvidešimt meistrų ir visus juos pažinojau. Dabar gi susidaro įspūdis, kad tatuiruotes gali daryti kas tik nori. Bet čia nieko nuostabaus. Išaugus paklausai auga ir pasiūla. Prie tokio augimo, manau, ta pati socialinė medija ir prisidėjo, bet tatuiravimo įrangos industrija atsigavo. Gaminama labai daug šaunių įrankių, kokybiškų dažų ir begalės priemonių, kurios palengvina darbą. Taip pat yra ir tam tikras nerašytas kodeksas tarp meistrų, kaip turi jaunas pradedantis meistras įeiti į bendruomenę. Teisingiausias kelias būtų susirasti mokytoją, bet tai yra labai sunku, nes ne kiekvienas nori dalintis savo patirtimi, o ir laiko tam sunku atrasti. Bet radus kelią į meistro širdį, sutapus vibracijoms ir biolaukams, galima rasti mokytoją, kuris atskleis visas paslaptis. Šiai dienai daugelis jaunų ir ambicingų meistrų kovoja dėl vietos po saule, švelniai tariant, ne pačiais teisingiausiais metodais, o pradirbus metus ar kelis jau nori save laikyti profesionalais, nors didelių laimėjimų ir nėra. – Kuo skiriasi klientai Lietuvoje ir užsienyje? – Kažkokio didelio skirtumo nesu pastebėjęs. Visi turi savo idėjas, vizijas ir norus. Ateina, dalijasi su meistru, kartu ieškome originalaus sprendimo. Tendencijų ir madų taip pat negalėčiau išskirti. Šiuolaikiniame pasaulyje tirpsta ribos tarp tautų ir nacijų, nes žmones keliauja emigruoja, susimaišo, supanašėja. – Tačiau nepaisant visko siekiate ir vis labiau supažindinti Lietuvos gyventojus su tatuiruočių menu, organizuojate vieninteles Lietuvoje konvencijas. Ar išaugo populiarumas ir susidomėjimas ir kaip jos keičiasi? – Konvencija Lietuvoje buvo mano asmeninė ambicija, nes jaučiau, kad galiu suburti bendraminčių grupes. Viskas prasidėjo nuo „Lietuvos Opel Calibra klubo“, kur teko organizuoti respublikinius suvažiavimus Klaipėdoje. Man puikiai sekėsi organizuoti, todėl ėmiausi lyderio vaidmens. Vėliau sekė didesnis projektas „Memel Tattoo Party“, kur tiesiog sukviečiau meistrus į vieną Klaipėdos roko klubų. Tai taip pat puikiai pavyko. Ir tik vėliau kartu su savo bičiuliu Aurimu Mockumi, kuris taip pat turi puikių organizacinių savybių, ėmėmės „Memel Tattoo Convention“. Mes suvokėme, kad tokio renginio nėra nei Lietuvoje, nei Baltijos šalyse, o susidomėjimas tatuiruotėmis auga kaip ant mielių. Sunkiausia buvo rasti vietą, kuri atitiktų konvencijos formatą. Tad 2014 metais ryžomės avantiūrai ir pirmąją konvenciją suorganizavome sename jachtų angare. Nors ir vieta buvo romantiška, bet patalpų kokybė - apgailėtina. Turėjome įdėti labai daug pastangų, kad nors kiek pagerintume patalpų būklę. Vėliau Klaipėdoje atsivėrė nauja erdvė „Kultūros Fabrikas“ ir mes įžvelgėme milžinišką potencialą, nors ta vieta ir nelabai atitiko tikslų konvencijos formatą, bet tuo pačiu tai tapo ir privalumu. Konvencijų publika labai skirtinga. Jose renkasi ne tik tatuiruočių mylėtojai, bet ir šiaip smalsūs ir žingeidūs miestelėnai. Žmonės ateina su vaikais, o mus tai labai džiugina. – Ar lengva prisikviesti garsius meistrus iš kitų šalių? – Su žymiais meistrais labai sudėtinga. Dažnas net neatsako į žinutes. Tenka ieškoti tarpinių žmonių, kurie galėtu padėti tiesiog susisiekti, bet žvaigždės renkasi didžiausias konvencijas (Londono, Amsterdamo, Stokholmo),nes ten didesnė rinka, geresne ekonominė situacija, o jų valandiniai honorarai neretam lietuviui gali pasirodyti absurdiški. Mes stengiames juos prisivilioti nemokamomis darbo vietomis ir apgyvendinimu, suteikiam VIP svečio statusą. Tačiau esame maža šalis, o čia nedidelė konvencija, todėl konkuruoti sunku. – O kaip vizituojantys meistrai? – Galiu tik pasidžiaugti, kad šiais metais mano studijoje svečiavosi net 10 meistrų. Žinoma, daugiausiai tai užsienyje dirbantys ir gyvenantys lietuvaičiai, atvykę kelioms savaitėm į Lietuvą, bet svečiavosi ir ispanas Raul Teruel Esteo bei meistrė iš Olandijos Debbie Zandvoort, kurie puikiai įvertino studijos atmosferą, o man tai buvo didžiausias komplimentas. Meistrų vizitavimas kitose šalyse labai populiarėja. Žmones nori bendrauti, susipažinti, pasidalinti ar tiesiog patirti naują nuotykį. – Kaip manote, kaip apskritai keisis tatuiruočių kultūra Lietuvoje? – Laikas parodys ir atsijos, kaip sakoma, grūdus nuo pelų. Stebiu visą situaciją Lietuvoje ir galiu pasakyti tik tiek, kad jei taip yra, vadinasi, taip turi būti. Vyksta natūralūs procesai. Dabar rinka Lietuvoje labai paklausi, todėl atsiranda pasiūla, o ji labai įvairi. Sumažės paklausa ir išliks tik patys stipriausi. Aš esu už švarią ir sąžiningą konkurenciją, kuri tik kelia bendrą tatuiravimo lygį Lietuvoje.
